import { Statement } from '@/types/statement';
import { format } from 'date-fns';

const formatPnbDate = (value: string | Date) => 
  format(typeof value === 'string' ? new Date(value) : value, 'dd/MM/yyyy');

const formatAmount = (value: number) => 
  value.toLocaleString('en-IN', { minimumFractionDigits: 2, maximumFractionDigits: 2 });

const buildPnbLogo = () => `
  <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="1000" height="147" viewBox="0 0 1177 147">
                    <image xlink:href="data:image/png;base64," x="0" y="0" width="1177" height="147"/>
                  </svg>
`;

export const renderPnbTemplate = (statement: Statement) => {
  const { details, transactions, meta } = statement;
  
  // Use period dates from meta if available, otherwise calculate from transactions
  const startDate = meta.statementPeriodStart ?? (transactions[0]?.date ?? meta.generatedAt);
  const endDate = meta.statementPeriodEnd ?? (transactions[transactions.length - 1]?.date ?? meta.generatedAt);

  const totalCredit = transactions.reduce((sum, txn) => sum + txn.credit, 0);
  const totalDebit = transactions.reduce((sum, txn) => sum + txn.debit, 0);
  const closingBalance = transactions.length 
    ? transactions[transactions.length - 1].balance 
    : details.startingBalance;

  const pageTotal = transactions.length;
  const grandTotal = closingBalance;

  const transactionRows = transactions
    .map((txn) => `
      <tr>
        <td>${formatPnbDate(txn.date)}</td>
        <td>${txn.reference || ''}</td>
        <td>${txn.debit > 0 ? formatAmount(txn.debit) : (txn.credit > 0 ? formatAmount(txn.credit) : '')}</td>
        <td style="font-weight: bold;">${txn.debit > 0 ? 'DR' : 'CR'}</td>
        <td style="font-weight: bold;">${formatAmount(txn.balance)}</td>
        <td>${txn.description.replace(/\n/g, '<br/>')}</td>
      </tr>
    `)
    .join('');

  return `<!DOCTYPE html>
  <html>
    <head>
      <meta charset="utf-8" />
      <title>Punjab National Bank - Statement of Account</title>
      <style>
        @page { margin: 0.5cm; size: A4; }
        * { box-sizing: border-box; margin: 0; padding: 0; }
        body { 
          font-family: 'Times New Roman', serif; 
          font-size: 12pt; 
          line-height: 1.2;
          color: #000;
          background: #fff;
          padding: 8px;
        }
        
        .branch-section {
          margin: 8px 0 10px 0;
          font-size: 10pt;
        }
        
        .branch-title {
          font-weight: 700;
          font-size: 12pt;
          margin-bottom: 3px;

        }
        
        .branch-details {
          margin-bottom: 1px;
        }
        
        .branch-label {
          display: inline-block;
          width: 110px;
          font-weight: 400;
        }
        
        .customer-section {
          margin: 10px 0;
          font-size: 11pt;
          line-height: 1.3;
        }
        
        .customer-title {
          font-weight: 700;
          font-size: 12pt;
          margin-bottom: 3px;
        }
        
        .customer-details {
          margin-bottom: 1px;
          line-height: 1.4;
        }
        
        .customer-label {
          display: inline-block;
          width: 130px;
          font-weight: 400;
        }
        
        .statement-title {
          font-weight: 700;
          font-size: 12pt;
          margin: 10px 0 6px 0;
          text-align: left;
        }
        
        table {
          width: 100%;
          border-collapse: collapse;
          margin: 6px 0;
          font-size: 7pt;
        }
        
        thead th {
          background: #808080;
          border: 1px solid #000;
          padding: 6px 10px;
          font-weight: bold;
          text-align: center;
          font-size: 12pt;
          line-height: 1.2;
        }
        
        tbody td {
          border: 1px solid #000;
          padding: 6px 10px;
          font-size: 12pt;
          font-weight: bold;
          line-height: 1.3;
          vertical-align: top;
          text-align: center;
        }
        
        tbody td:nth-child(1) {
          text-align: center;
        }
        
        tbody td:nth-child(2) {
          text-align: center;
        }
        
        tbody td:nth-child(3) {
          text-align: right;
        }
        
        tbody td:nth-child(4) {
          text-align: center;
        }
        
        tbody td:nth-child(5) {
          text-align: right;
        }
        
        tbody td:nth-child(6) {
          text-align: center;
          word-wrap: break-word;
        }
        
        .footer-text {
          font-family: 'Times New Roman', Times, serif;
          font-size: 12pt;
          text-align: left;
          margin-top: 15px;
          line-height: 1.5;
        }
        
        .footer-title {
          font-family: 'Times New Roman', Times, serif;
          text-align: center;
          font-weight: 700;
          font-size: 12pt;
          margin-bottom: 10px;
        }
        
        .footer-bullet {
          font-family: 'Times New Roman', Times, serif;
          font-size: 12pt;
          margin-bottom: 6px;
          padding-left: 20px;
          text-indent: -12px;
        }
      </style>
    </head>
    <body>
      ${buildPnbLogo()}

      <!-- Branch Details -->
      <div class="branch-section">
        <div class="branch-title">Branch Details</div>
        <div class="branch-details">
          <span class="branch-label">Branch Name:</span> ${details.bankBranch || details.branch || 'CHOPRA KALAN, DISTT. BHOPAL'}
        </div>
        <div class="branch-details">
          <span class="branch-label">Branch Address:</span> ${details.branchAddress || 'VILL CHOPRA KALAN, PO'}
        </div>
        <div class="branch-details">
          <span class="branch-label">City:</span> ${details.city || 'BHOPA'}
        </div>
        <div class="branch-details">
          <span class="branch-label">Pin:</span> 462010
        </div>
        <div class="branch-details">
          <span class="branch-label">IFSC Code:</span> ${details.ifsc}
        </div>
      </div>

      <!-- Customer Details -->
      <div class="customer-section">
        <div class="customer-title">Customer Details:</div>
        <div class="customer-details">
          <span class="customer-label">Customer Name:</span> ${details.name.toUpperCase()}
        </div>
        <div class="customer-details">
          <span class="customer-label">Customer Address:</span> ${details.address?.toUpperCase() || 'C/O BHOJRAJ, GRAM IMALIYA, , IMALIYA'}
        </div>
        <div class="customer-details">
          <span class="customer-label">City:</span> ${details.city || 'BHOPAL'}
        </div>
        <div class="customer-details">
          <span class="customer-label">Pin:</span> 462010
        </div>
        <div class="customer-details">
          <span class="customer-label">CKYC Number:</span>
        </div>
        <div class="customer-details">
          <span class="customer-label">Nominee:</span>
        </div>
      </div>

      <!-- Statement Title -->
      <div class="statement-title">Statement of Account:${details.accountNumber} For Period: ${formatPnbDate(startDate)} to ${formatPnbDate(endDate)}</div>

      <!-- Transaction Table -->
      <table>
        <thead>
          <tr>
            <th style="width: 10%;">Date</th>
            <th style="width: 12%;">Instrument ID</th>
            <th style="width: 12%;">Amount</th>
            <th style="width: 6%;">Type</th>
            <th style="width: 12%;">Balance</th>
            <th style="width: 48%;">Remarks</th>
          </tr>
        </thead>
        <tbody>
          ${transactionRows}
        </tbody>
      </table>

      <div class="footer-text">
        <div class="footer-title">***Generated through PNB ONE***</div>
        <div class="footer-bullet"> Unless constituent notifies the bank immediately of any discrepancy found by him in his statement of Account,it will be taken that he has found the account correct.</div>
        <div class="footer-bullet"> Computer generated entries shown in the statement of account do not require any authentication / initial from the bank official. please do not accept any manual entry in your computer generated statement of account.</div>
        <div class="footer-bullet"> Please ensure that all the cheque leaved in your custody is duly branded with your 16 digits account number.</div>
        <div class="footer-bullet"> Customer are requested in their own interest not to issues cheques without adequate clear funds / arrangements.Such cheques can be returned without making any further reference to them.</div>
        <div class="footer-bullet"> Please maintain minimum average balance, to avoid levy of charges.</div>
        <div class="footer-bullet"> Please note Penal interest may be charged in loan accounts due to financial reasons such as over drawings, non receipt of install on the rates prescribed by bank from time to timeand for non financial reasons like non submission of QMS forms, non adherence to terms and conditions etc.</div>
      </div>
    </body>
  </html>`;
};

export default renderPnbTemplate;
